import React, {Component} from 'react';
import Layout from '../../components/Layout';
import {Dropdown, Grid} from 'semantic-ui-react';

let actSetList = {}

export default class MainMenu extends Component {
  render() {
    return(
      <Layout>
        <Grid>
          <Grid.Row>
            <Grid.Column width={4}>
              <h2>Choose Activity Set</h2>
            </Grid.Column>
            <Grid.Column width={5}>
              <Dropdown fluid placeholder='Activity Set' search selection options={actSetList}/>
            </Grid.Column>
          </Grid.Row>
        </Grid>
      </Layout>
    );
  }
}
